INSERT INTO `recipe` VALUES (1,'Jamaican Jerk Chicken','Cooking',10,3,'A spicy and flavorful chicken dish with traditional Jamaican spices.',20,100,120,'Marinate overnight for best flavor','Use a meat thermometer to ensure chicken is cooked','Serve with rice and peas for a complete meal',10,'2024-05-23 21:48:26'),(2,'Pasta Salad','Cooking',1,1,'A refreshing and versatile salad with pasta and fresh vegetables.',15,15,30,'Chill before serving','Use a variety of colorful vegetables','Add a protein like chicken or tofu',2,'2024-05-23 21:48:26'),(3,'Lasagna','Cooking',2,4,'A classic Italian dish with layers of pasta, cheese, and meat sauce.',30,60,90,'Let lasagna rest before cutting','Use no-boil noodles to save time','Add spinach or other veggies for extra nutrition',2,'2024-05-23 21:48:26'),(4,'Hearty Pancakes','Pastry',1,1,'Fluffy and delicious pancakes perfect for a hearty breakfast.',10,10,20,'Do not overmix the batter','Use buttermilk for fluffier pancakes','Keep pancakes warm in the oven',1,'2024-05-23 21:48:26'),(5,'Summer Garden Couscous Salad','Cooking',11,1,'A light and refreshing couscous salad with summer vegetables.',10,15,25,'Fluff couscous with a fork','Add fresh herbs for extra flavor','Serve chilled or at room temperature',4,'2024-05-23 21:48:26'),(6,'Squash Corn Chowder','Cooking',1,2,'A creamy and comforting chowder with squash and corn.',15,30,45,'Blend part of the soup for creaminess','Use fresh corn for best flavor','Serve with crusty bread',4,'2024-05-23 21:48:26'),(7,'White Beans, Tomatoes, and Spinach','Cooking',2,2,'A healthy and quick dish with white beans, tomatoes, and spinach.',10,10,20,'Use canned beans for convenience','Add a splash of lemon juice for brightness','Top with grated Parmesan cheese',5,'2024-05-23 21:48:26'),(8,'Spaghetti','Cooking',2,1,'A simple and classic pasta dish with tomato sauce.',10,15,25,'Salt the pasta water','Reserve some pasta water to adjust sauce consistency','Use fresh basil for garnish',2,'2024-05-23 21:48:26'),(9,'Scones','Pastry',12,2,'Classic British scones, perfect with tea or coffee.',15,15,30,'Do not overwork the dough','Use cold butter for flakier scones','Brush with cream before baking for a golden top',12,'2024-05-23 21:48:26'),(10,'Pizza','Cooking',2,3,'A classic homemade pizza with customizable toppings.',20,70,90,'Use a pizza stone for a crispy crust','Preheat the oven for at least 30 minutes','Let the dough rest for better texture',4,'2024-05-23 21:48:26'),(11,'Stir-Fry','Cooking',4,2,'A quick and easy stir-fry with fresh vegetables and your choice of protein.',10,10,20,'Prep all ingredients before starting','Cook at high heat','Use a variety of colorful veggies',4,'2024-05-23 21:48:26'),(12,'Rustic Italian Tortellini Soup','Cooking',2,2,'A hearty and comforting soup with tortellini and Italian flavors.',15,25,40,'Use fresh tortellini for best results','Add spinach at the end for color','Serve with crusty bread',6,'2024-05-23 21:48:26'),(13,'Swedish Meatballs','Cooking',8,3,'Classic Swedish meatballs in a creamy sauce.',20,30,50,'Use a mixture of beef and pork','Chill meatballs before cooking to hold shape','Serve with mashed potatoes or noodles',4,'2024-05-23 21:48:26'),(14,'Barley Beef Skillet','Cooking',1,2,'A savory beef and barley skillet meal.',15,30,45,'Use pearl barley for quicker cooking','Add vegetables for extra nutrition','Season well with herbs',4,'2024-05-23 21:48:26'),(15,'Southwest Beef & Rice Skillet','Cooking',1,2,'A flavorful skillet dish with beef, rice, and southwest spices.',10,20,30,'Use pre-cooked rice to save time','Add corn and black beans','Top with cheese and avocado',4,'2024-05-23 21:48:26'),(16,'Glazed Pork Chops with Corn Bread Dressing','Cooking',1,3,'Tender pork chops with a sweet glaze and savory corn bread dressing.',20,40,60,'Sear pork chops before baking','Use bone-in chops for more flavor','Let pork rest before serving',4,'2024-05-23 21:48:26'),(17,'Fried Rice','Cooking',4,1,'A quick and versatile fried rice with vegetables and your choice of protein.',10,10,20,'Use day-old rice for best texture','Cook eggs first and set aside','Add soy sauce gradually',4,'2024-05-23 21:48:26'),(18,'Zesty Sausage & Beans','Cooking',1,2,'A spicy and hearty dish with sausage and beans.',10,20,30,'Use smoked sausage for more flavor','Add chili flakes for extra heat','Serve with crusty bread',4,'2024-05-23 21:48:26'),(19,'Prosciutto Pasta Toss','Cooking',2,1,'A simple and elegant pasta dish with prosciutto.',10,15,25,'Reserve pasta water for sauce','Add fresh arugula for peppery flavor','Top with grated Parmesan',4,'2024-05-23 21:48:26'),(20,'Cashew Chicken with Noodles','Cooking',4,2,'A savory and crunchy cashew chicken served over noodles.',15,15,30,'Toast cashews for extra flavor','Use fresh ginger and garlic','Garnish with green onions',4,'2024-05-23 21:48:26'),(21,'Herb Chicken with Honey Butter','Cooking',1,2,'Juicy herb-seasoned chicken with a sweet honey butter glaze.',15,30,45,'Use fresh herbs for best flavor','Baste chicken with pan juices','Let chicken rest before serving',4,'2024-05-23 21:48:26'),(22,'French Toast','Cooking',5,1,'An easy recipe for everyone at home.',2,8,10,'Thick slices of bread','Make sure the mixture is well-combined','Keep the cooked slices warm in a low oven while you finish cooking the remaining batches',2,'2024-05-23 21:48:26'),(23,'Swedish Pancakes','Pastry',8,2,'Thin and delicate pancakes served with lingonberry jam or fresh berries.',15,15,30,'Use a non-stick pan','Spread batter thinly and evenly','Serve immediately',4,'2024-05-23 21:48:26'),(24,'Baked Cheddar Eggs & Potatoes','Cooking',1,2,'A savory breakfast bake with eggs, cheddar cheese, and potatoes.',15,30,45,'Use shredded hash browns for convenience','Mix in some veggies for extra flavor','Top with fresh herbs',6,'2024-05-23 21:48:26'),(25,'Baked Mostaccioli','Cooking',2,2,'A baked pasta dish with marinara sauce, mozzarella, and Parmesan cheese.',20,40,60,'Use penne pasta if mostaccioli is unavailable','Add a layer of ricotta for creaminess','Cover with foil to prevent drying out',6,'2024-05-23 21:48:26'),(26,'Ravioli with Snap Peas','Cooking',2,2,'A light and fresh pasta dish with cheese ravioli and snap peas.',10,15,25,'Blanch snap peas briefly for crispness','Use fresh ravioli for best results','Garnish with lemon zest',4,'2024-05-23 21:48:26'),(27,'Cloverleaf Rolls','Pastry',1,3,'Soft and fluffy rolls shaped into cloverleaf patterns.',20,100,120,'Use warm milk for dough','Let dough rise until doubled','Brush with butter before baking',12,'2024-05-23 21:48:26'),(28,'Greek Yogurt and Honey Blueberry Muffins','Pastry',6,2,'Moist and flavorful muffins made with Greek yogurt, honey, and blueberries.',15,20,35,'Use fresh or frozen blueberries','Do not overmix the batter','Sprinkle with coarse sugar before baking',12,'2024-05-23 21:48:26'),(29,'Whole Grain Waffles','Pastry',1,2,'Healthy and hearty whole grain waffles perfect for breakfast.',10,15,25,'Preheat the waffle iron','Do not overfill the waffle iron','Serve with fresh fruit and syrup',4,'2024-05-23 21:48:26'),(30,'Lemon Bars','Pastry',1,2,'Tangy and sweet lemon bars with a buttery crust.',15,30,45,'Use fresh lemon juice','Chill before cutting','Dust with powdered sugar before serving',16,'2024-05-23 21:48:26'),(31,'Qahaq Cookies','Pastry',20,2,'Traditional Maltese cookies flavored with cardamom and filled with dates.',20,40,60,'Use fresh dates for filling','Chill dough before shaping','Sprinkle with powdered sugar',24,'2024-05-23 21:48:26'),(32,'Blondies with Nutella','Pastry',1,2,'Rich and chewy blondies swirled with Nutella.',15,25,40,'Do not overbake','Swirl Nutella gently into batter','Let cool before cutting',16,'2024-05-23 21:48:26'),(33,'Hot Chocolate','Cooking',9,1,'A rich and creamy hot chocolate made with real chocolate.',5,10,15,'Use high-quality chocolate','Whisk constantly to avoid burning','Top with whipped cream or marshmallows',4,'2024-05-23 21:48:26'),(34,'Chocolate Mousse','Pastry',5,2,'A rich 