INSERT INTO `steps` VALUES (1,'Marinate chicken with jerk seasoning, lime juice, and oil.',1,'2024-05-24 09:18:38'),(1,'Preheat grill to medium-high heat.',2,'2024-05-24 09:18:38'),(1,'Grill chicken until cooked through, about 6-7 minutes per side.',3,'2024-05-24 09:18:38'),(1,'Let chicken rest for a few minutes before serving.',4,'2024-05-24 09:18:38'),(2,'Cook pasta according to package instructions; drain and rinse under cold water.',1,'2024-05-24 09:18:38'),(2,'In a large bowl, combine cooked pasta, diced vegetables, and dressing.',2,'2024-05-24 09:18:38'),(2,'Toss salad gently to combine all ingredients evenly.',3,'2024-05-24 09:18:38'),(2,'Refrigerate for at least 1 hour before serving to allow flavors to meld.',4,'2024-05-24 09:18:38'),(3,'Preheat oven to 375°F (190°C).',1,'2024-05-24 09:18:38'),(3,'Spread a thin layer of sauce on the bottom of a baking dish.',2,'2024-05-24 09:18:38'),(3,'Layer noodles, sauce, ricotta, and mozzarella in the baking dish.',3,'2024-05-24 09:18:38'),(3,'Repeat layers until all ingredients are used, ending with a layer of sauce and mozzarella on top.',4,'2024-05-24 09:18:38'),(3,'Cover with foil and bake for 45 minutes.',5,'2024-05-24 09:18:38'),(3,'Remove foil and bake for an additional 15 minutes or until cheese is bubbly and golden brown.',6,'2024-05-24 09:18:38'),(4,'In a mixing bowl, combine flour, baking powder, salt, and sugar.',1,'2024-05-24 09:18:38'),(4,'In another bowl, whisk together eggs, milk, and melted butter.',2,'2024-05-24 09:18:38'),(4,'Pour wet ingredients into dry ingredients and stir until just combined.',3,'2024-05-24 09:18:38'),(4,'Heat a lightly greased griddle or skillet over medium heat.',4,'2024-05-24 09:18:38'),(4,'Pour batter onto the griddle, using approximately 1/4 cup for each pancake.',5,'2024-05-24 09:18:38'),(4,'Cook until bubbles form on the surface, then flip and cook until golden brown.',6,'2024-05-24 09:18:38'),(4,'Serve hot with your favorite toppings.',7,'2024-05-24 09:18:38'),(5,'Cook couscous according to package instructions; fluff with a fork and let cool.',1,'2024-05-24 09:18:38'),(5,'In a large bowl, combine cooled couscous with chopped vegetables, herbs, and dressing.',2,'2024-05-24 09:18:38'),(5,'Toss salad gently to combine all ingredients evenly.',3,'2024-05-24 09:18:38'),(5,'Refrigerate for at least 30 minutes before serving to allow flavors to meld.',4,'2024-05-24 09:18:38'),(6,'In a large pot, heat olive oil over medium heat.',1,'2024-05-24 09:18:38'),(6,'Add diced onion, celery, carrots, and garlic; sauté until softened.',2,'2024-05-24 09:18:38'),(6,'Stir in diced squash, corn kernels, vegetable broth, and seasonings.',3,'2024-05-24 09:18:38'),(6,'Bring to a boil, then reduce heat and simmer for 20-25 minutes until vegetables are tender.',4,'2024-05-24 09:18:38'),(6,'In a small bowl, mix flour with a bit of water to create a slurry; stir into the chowder to thicken.',5,'2024-05-24 09:18:38'),(6,'Simmer for an additional 5-10 minutes until chowder is thickened.',6,'2024-05-24 09:18:38'),(6,'Season with salt and pepper to taste before serving.',7,'2024-05-24 09:18:38'),(7,'Heat olive oil in a large skillet over medium heat.',1,'2024-05-24 09:18:38'),(7,'Add minced garlic and cook until fragrant, about 1 minute.',2,'2024-05-24 09:18:38'),(7,'Add diced tomatoes (with juices) and white beans; cook until heated through.',3,'2024-05-24 09:18:38'),(7,'Stir in fresh spinach and cook until wilted.',4,'2024-05-24 09:18:38'),(7,'Season with salt, pepper, and any additional desired seasonings.',5,'2024-05-24 09:18:38'),(7,'Serve hot as a side dish or over cooked grains.',6,'2024-05-24 09:18:38'),(8,'Cook spaghetti according to package instructions; drain and set aside.',1,'2024-05-24 09:18:38'),(8,'In a large skillet, heat olive oil over medium heat.',2,'2024-05-24 09:18:38'),(8,'Add minced garlic and cook until fragrant, about 1 minute.',3,'2024-05-24 09:18:38'),(8,'Stir in diced tomatoes, tomato sauce, Italian seasoning, salt, and pepper.',4,'2024